CREATE  PROCEDURE `change_merch_show_time` (IN `showtime` DATETIME, IN `merchid` VARCHAR(20) CHARSET utf8)  NO SQL
BEGIN
UPDATE MERCHANDISE SET MERCHANDISE.SHOWTIME = showtime WHERE MERCHANDISE.ID = merchid;
UPDATE PAID_ORDER SET PAID_ORDER.DEADLINE = showtime WHERE PAID_ORDER.MERCHID = merchid;
END$$

CREATE  PROCEDURE `check_preorder_status` ()  NO SQL
BEGIN
DECLARE id_ varchar(50);
DECLARE time_ datetime;
DECLARE sta_ int(11);
DECLARE flag int DEFAULT true;
DECLARE c CURSOR FOR(SELECT `ID`,`DESTROYTIME`,`PAYSTATUS` FROM `PRE_ORDER`);
DECLARE CONTINUE HANDLER FOR NOT FOUND SET flag = false;

OPEN c;
REPEAT
	FETCH c INTO id_,time_, sta_;
    IF(time_< CURRENT_TIME AND sta_ = '0')
    	THEN UPDATE `PRE_ORDER` SET `PAYSTATUS` = '2' WHERE `ID` = id_;
    END IF;
until flag = false END REPEAT;
CLOSE c;
END$$

CREATE  PROCEDURE `createDefAddr` (IN `def_addr` VARCHAR(50) CHARSET utf8, IN `def_phone` VARCHAR(20) CHARSET utf8, IN `_openid` VARCHAR(30))  NO SQL
