CREATE  PROCEDURE `insert_paid_order` (IN `orderid` VARCHAR(50) CHARSET utf8, IN `userid` BIGINT(20), IN `merchid` VARCHAR(20) CHARSET utf8, IN `discount` INT(11), IN `pointsused` INT(11), IN `points` INT(11), IN `merchcost` INT(11), IN `finalcost` INT(11), IN `amount` INT(11), IN `address` VARCHAR(50) CHARSET utf8, IN `phone` VARCHAR(20) CHARSET utf8)  NO SQL
BEGIN
DECLARE deadline DATETIME;
DECLARE stat BIT;
SELECT SHOWIME FROM MERCHANDISE WHERE ID = merchid INTO deadline;
SELECT * FROM `PRE_ORDER` WHERE `PRE_ORDER`.`ID` = orderid FOR UPDATE;
UPDATE `PRE_ORDER` SET `PAYSTATUS` = '1' WHERE `PRE_ORDER`.`ID` = orderid AND `PAYSTATUS` = '0';
SELECT `PAYSTATUS` FROM `PRE_ORDER` WHERE `PRE_ORDER`.`ID` = orderid INTO stat;
IF (stat = '1') THEN
INSERT INTO `PAID_ORDER` (`USERID`, `ORDERID`, `MERCHID`, `PAIDTIME`, `STATUS`, `DISCOUNT`, `POINTSUSED`, `POINTS`, `MERCHCOST`, `FINALCOST`, `AMOUNT`, `ADDRESS`, `PHONE`, `DEADLINE`) VALUES (userid, orderid, merchid, CURRENT_TIMESTAMP, b'0', discount, pointsused, points, merchcost, finalcost, amount, address, phone, deadline);
END IF;
END$$

CREATE  PROCEDURE `pick_merch_amount` (IN `input_id` VARCHAR(20) CHARSET utf8, IN `input_amount` INT(11))  NO SQL
BEGIN
DECLARE old_amount INT;
DECLARE new_amount INT;
SELECT AMOUNT FROM MERCHANDISE WHERE ID = input_id INTO old_amount FOR UPDATE;
SET new_amount = old_amount - input_amount;
IF (new_amount >= 0) THEN
	UPDATE `MERCHANDISE` SET `AMOUNT` = new_amount WHERE `ID` = input_id;

ELSE
	COMMIT;
END IF;
END$$

CREATE  PROCEDURE `refill_merch_amount` (IN `input_id` VARCHAR(20) CHARSET utf8, IN `input_amount` INT(11))  NO SQL
BEGIN
DECLARE old_amount INT;
SELECT AMOUNT FROM MERCHANDISE WHERE ID = input_id INTO old_amount FOR UPDATE;
UPDATE MERCHANDISE SET AMOUNT = old_amount + input_amount WHERE ID = input_id;
END$$

